import React from 'react';

const person = (props) =>{
    return (
        <div>
            <p onClick={props.click}>PersonName:{props.name} age:{props.age}</p>
            <p> {props.children} </p>
            <input type="text" onChange={props.change}/>
        </div>
    )};

export default person;
